    <div className="char-wrapper">
      <p>Select Character</p>
      <div>
        <img src={luigi} alt="luigi" />
        <span>Luigi</span>
      </div>
      <div>
        <img src={ariel} alt="ariel" />
        <span>Ariel</span>
      </div>
      <div>
        <img src={simba} alt="simba" />
        <span>Simba</span>
      </div>
    </div>
  );
}
